// import Vue
import Vue from 'vue'
// import APP
import App from './App.vue'
// import VueRouter plugin
import VueRouter from 'vue-router'
Vue.config.productionTip = false
// use VueRouter
Vue.use(VueRouter)

new Vue({
  el:'#app',
  render: h => h(App),

}).$mount('#app')
